WARN: Technical info ahead! This describes how things work in memory internally. This section is not required to understand, and feel free to skip. But for some readers, this might give some insight and understanding on Enums. Don't obsess into understanding everything; just a general overview here is fine. In C++ (and Rust) we have something called "unions". A union is a type where all contents will be stored in the same place in memory. union MyData { integer: i64, float: f32, text: [char; 20],
} These contents will be put one on top of the other, overlapping the same region in memory. If we did a struct like that: struct MyData { integer: i64, float: f32, text: [char; 20],
} In the memory we will have: integer float text
[________][____][____________________] All variables will be packed one after another. However, if we were only going to use one of those at a time, we would be wasting a lot of memory of the computer. Unions instead put everything in the same place: [________] integer
[____] float
[____________________] text Or, more accurately: float integer text
[____]___]___________] There are bytes in memory that will be shared across the float, the integer, and the text. Because of this, they use only the memory needed to hold the largest variable that they can contain. This makes unions very dangerous as if you write text and then read float you'll get back basically garbage. That's why, in Rust, reading unions is unsafe. But if we knew what field we wrote, then we could actually read it without risk of getting back garbage. Imagine we had constants to specify which field it is: const FIELD_FLOAT: u8 = 0;
const FIELD_INTEGER: u8 = 1;
const FIELD_TEXT: u8 = 2; And then we store this along with the union, inside a struct: union MyData { integer: i64, float: f32, text: [char; 20],
} struct MyDataSafe { field_written: u8, data: MyData,
} Now, as long as we always keep the field_written up to date, we know which one was used, so we can read confidently data without risk of getting back corrupted values. We could write an implementation like this to ensure this is the case: impl MyDataSafe { pub fn write_integer(&mut self, i: i64) { self.field_written = FIELD_INTEGER; self.data.integer = i; } pub fn write_float(&mut self, f: f32) { self.field_written = FIELD_FLOAT; self.data.float = f; } pub fn write_text(&mut self, t: [char; 20]) { self.field_written = FIELD_TEXT; self.data.text = t; }
} And we could read "safely": impl MyDataSafe { pub fn read_integer(&self) -> i64 { if self.field_written != FIELD_INTEGER { panic!("wrong field type"); } unsafe {self.data.integer} } pub fn write_float(&self) -> f32 { if self.field_written != FIELD_FLOAT { panic!("wrong field type"); } unsafe {self.data.float} } pub fn write_text(&self) -> [char; 20] { if self.field_written != FIELD_TEXT { panic!("wrong field type"); } unsafe {self.data.text} }
} Notice two things here. First, when we created the struct: struct MyDataSafe { field_written: u8, data: MyData,
} The layout in memory is: float integer text
[_][____]___]___________] ^ --- field_written Second, those constants: const FIELD_FLOAT: u8 = 0;
const FIELD_INTEGER: u8 = 1;
const FIELD_TEXT: u8 = 2; Are actually a regular C++ enum: enum Field { Float, Integer, Text,
} And the struct: struct MyDataSafe { field_written: u8, data: MyData,
} Is actually an equivalent of a Rust Enum! enum Field { Float(f32), Integer(i64), Text([char; 20]),
} That's what it actually is! Rust enums are kind of "safe C++ style unions". They use only the memory needed for the biggest value possible of all options, and they're safe. Plus an extra byte or two to hold which variant are we talking about. In some cases, Rust is "too smart" and it's able to omit the extra byte needed to store the variant by using some tricks when compiling. But that is outside what I want to cover here.

