Let's begin saying that, in math: \[ 1.1 + 1.1 + 1.1 = 3.3 \] That is obvious. But in computers: let a = 1.1;
let b = 3.3; let c = a + a + a; println!("b = {}", b);
println!("c = {}", c);
println!("b == c? -> {}", b == c);
println!("b - c = {}", b - c); b is not equal to c. The difference is -0.0000000000000004440892098500626. Of course, this is wrong. The difference should have been zero. But this is not how computers work. Surprised? We thought computers were stupid glorified calculators, but they can't even get a simple sum right. This is because how decimals work in a computer when using floating points. They use base 2 (ones and zeros) to represent the numbers, and when we have a number that has a decimal point, this becomes a problem. If you're not interested on the explanation, just remember that you cannot expect any two floats to be equal. You have to check if they are "close enough". Also, before converting them to integer, you first have to round them. You might think you have 295.0 but in reality it might be 294.999999999996, and if you just cut the decimals instead of rounding you get 294 instead of 295. It feels stupid, because it is. We need to understand that not all numbers can be written down. Yes, let that sink in. There are numbers you can't write. For example \(\pi\), we can write 3.1415 but doesn't matter for how long we try, it will never be the real \(\pi\). Because it's irrational. But on the real numbers it also happens. Even in the rational ones (fractional). A common example is \(10 / 3\): \[\frac{10}{3}=3.333333333…\] It doesn't matter how long you keep writing, you cannot write it down. Why? Well, our system is decimal, base 10. And \(10 = 2 × 5\). This means we can only represent fractions that divide by multiples of 2 and 5. So, for example the following fractions are representable: \[\frac{1}{25}\] \[\frac{6}{2560}\] But \(1/3\) is not, because 3 is a prime, and our decimal system doesn't include 3 as a factor. Now, for a computer that is using a binary system the only factor is 2. This means that when a number is the result of dividing by 5, we can probably represent, but the computer cannot. The number 1.1 is in reality: \[\frac{11}{2 × 5}\] The computer can represent \(11/2=5.5\) but not \(11/10=1.1\). That will lead to infinite decimals, but a f64 will cut at some point. And there you have your imprecision. While your written number comes with full precision, the one written by the computer can't get that level of precision regardless of having 20 or 500 decimal places. Do you think it's lame? Try writing down: \[\frac{100}{29}\] \[\frac{100}{53}\] \[\frac{100}{97}\] Were you able to do it? No? Lame! Well, that's how your computer feels. Please be respectful. They only have base 2 to work with.

