Having all the program into a single file stops being convenient as the program gets bigger and bigger. One hundred lines are fine, 1000 maybe, but 5000 is definitely too big to handle. The problem is as the file grows we easily lose track of things, in which parts they were and so on. The whole folder that cargo new created for us is called a project. So if we recall when we created the initial project: $ cargo new learnrust Created binary (application) `learnrust` package But so far we have been adding different binaries, and with that we have been creating different files. src
├── bin
│ ├── enums2.rs
│ ├── enums.rs
│ ├── hashmap.rs
│ ├── print.rs
│ ├── sample1.rs
│ ├── structs.rs
│ ├── turtle_loops.rs
│ ├── turtle_vars.rs
│ └── variables.rs
└── main.rs However, these are not modules! Those are binaries. Modules can be reused between different files while binaries can only be compiled as full programs. We cannot get a function from a binary into a different one. To share functionality we need to move it into modules. For example, let's say we need something to be reused. Maybe we want a file that contains units of measure. So we'll create a new file called src/units.rs. And we add a few units of length. Or all of them now that we're on this: pub enum LengthUnit { Kilometer, Meter, Millimeter, Inch, Angstrom, Mile, Furlong, Chain, Rod, Fathom, Yard, Foot, Parsec, LightYear, AstronomicalUnit,
} Yay! We got a new module. Or do we? So in order to be a full module we should be importing this from another file. For src/main.rs we can add the following line at the top: mod units; // <-- this line! fn main() { println!("Hello, world!");
} This will declare the module. Now we can use units::LengthUnit: mod units; fn main() { println!("Hello, world!"); let m = units::LengthUnit::LightYear; dbg!(m);
} This is difficult to type down, so we can add a use line to bring LengthUnit into scope: use units::LengthUnit; Then we can just do: let m = LengthUnit::LightYear; And that's it! We're sharing code across files. We just did a simple enum, but it can be constants, structs, functions, whatever.

