Doing everything by ourselves might be rewarding, but it is also tiring. It takes a lot of effort and knowledge to code a proper program that is really useful. But I like a saying that goes: "Don't reinvent the wheel" If you need something, it is highly probable that someone else did it already and shared it for free. Seriously. Most of the time it is just a problem of not googling enough, or using the right keywords. People share their functions and modules as libraries called "crates" in a site called https://crates.io . As a beginner, it is important to use as many crates as you can [1] . They will allow you to create interesting programs easily, giving you a good sense of progress. The first library I want you to try is "rand": https://crates.io/crates/rand This crate as the name suggests creates random numbers. We need to install it in our project, and for that, notice that on the right side of the website there are Install instructions and Documentation: So we will follow the installation instructions. We need to open our Cargo.toml file first. This file was created when we did cargo new. [package] name = "learnrust" version = "0.1.0" edition = "2021" # See more keys and their definitions at ... [dependencies] rand = "0.8.4" # Add dependencies here We add the new crate to this file by inserting the line rand = "0.8.4" as the instructions say just below the [dependencies]. If we execute now cargo run we get something different already: $ cargo run Compiling cfg-if v1.0.0 Compiling ppv-lite86 v0.2.15 Compiling libc v0.2.107 Compiling getrandom v0.2.3 Compiling rand_core v0.6.3 Compiling rand_chacha v0.3.1 Compiling rand v0.8.4 Compiling learnrust v0.1.0 (/home/deavid/git/rust/learnrust) Finished dev [unoptimized + debuginfo] target(s) in 2.54s Running `target/debug/learnrust` Hello world Cargo noticed that we have added a new dependency, so it downloaded the required libraries and compiled them too! A lot of work that didn't require almost any manual action from our side. The program however still does the same thing. Just installing a library is not going to make our program generate random numbers. The simplest way to start with it is to use rand::random(): fn main() { let randnum: i64 = rand::random(); println!("Hello world: {}", randnum);
